import React, { Fragment } from "react";
import "./App.css";
// Components
import AddServer from "./components/AddServer";
import ListServers from "./components/ListServers";

function App() {
	return (
		<Fragment>
			<div className="bg-light">
				<AddServer />
				<ListServers />
			</div>
		</Fragment>
	);
}

export default App;
